import React, { useState, useEffect } from "react";
import axios from "axios";

const filterOptions = ["state", "categories", "name", "city"];

export default function App() {
  const [businessData, setBusinessData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [filters, setFilters] = useState([]);
  const [filterType, setFilterType] = useState("state");
  const [filterValue, setFilterValue] = useState("");
  const pageSize = 25;

  const handleApplyFilters = () => {
    setCurrentPage(1);
    // Add the new filter to the array
    setFilters([...filters, { type: filterType, value: filterValue }]);
  };

  const handleRemoveFilter = (index) => {
    // Remove the filter at the specified index
    const updatedFilters = [...filters];
    updatedFilters.splice(index, 1);
    setFilters(updatedFilters);
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Format the filters array to a string for URL parameters
        const formattedFilters = filters
          .map(
            (filter) =>
              `filters[][type]=${filter.type}&filters[][value]=${filter.value}`
          )
          .join("&");

        const response = await axios.get(
          `http://localhost:3001/api/data?page=${currentPage}&pageSize=${pageSize}&${formattedFilters}`
        );
        setBusinessData(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [currentPage, filters]);

  return (
    <div className="p-3">
      {/* Filter dropdown */}
      <div className="mb-3">
        <label>Filter Type:</label>
        <select
          onChange={(e) => setFilterType(e.target.value)}
          value={filterType}
        >
          {filterOptions.map((option) => (
            <option key={option} value={option}>
              {option}
            </option>
          ))}
        </select>
      </div>

      {/* Filter value input */}
      <div className="mb-3">
        <label>Filter Value:</label>
        <input
          type="text"
          onChange={(e) => setFilterValue(e.target.value)}
          value={filterValue}
        />
      </div>

      {/* Apply Filters button */}
      <button className="btn btn-primary" onClick={handleApplyFilters}>
        Apply Filters
      </button>

      {/* Display applied filters as badges */}
      <div className="mt-3">
        {filters.map((filter, index) => (
          <span key={index} className="badge badge-primary mr-2">
            {`${filter.type}: ${filter.value}`}
            <button
              type="button"
              className="close"
              onClick={() => handleRemoveFilter(index)}
              aria-label="Close"
            >
              <span aria-hidden="true">&times;</span>
            </button>
          </span>
        ))}
      </div>

      <table className="table table-striped">
        <thead>
          <tr>
            <th scope="col">business_id</th>
            <th scope="col">name</th>
            <th scope="col">address</th>
            <th scope="col">city</th>
            <th scope="col">state</th>
            <th scope="col">postal_code</th>
            <th scope="col">stars</th>
            <th scope="col">review_count</th>
            <th scope="col">is_open</th>
            <th scope="col">categories</th>
          </tr>
        </thead>
        <tbody>
          {businessData.map((business) => (
            <tr key={business.business_id}>
              <td>{business.business_id}</td>
              <td>{business.name}</td>
              <td>{business.address}</td>
              <td>{business.city}</td>
              <td>{business.state}</td>
              <td>{business.postal_code}</td>
              <td>{business.stars}</td>
              <td>{business.review_count}</td>
              <td>{business.is_open}</td>
              <td>{business.categories}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className="d-flex justify-content-between align-items-center mb-3">
        <button
          className="btn btn-primary"
          onClick={() =>
            setCurrentPage((prevPage) => Math.max(prevPage - 1, 1))
          }
          disabled={currentPage === 1}
        >
          Previous Page
        </button>
        <span className="h5"> Page {currentPage} </span>
        <button
          className="btn btn-primary"
          onClick={() => setCurrentPage((prevPage) => prevPage + 1)}
        >
          Next Page
        </button>
      </div>
    </div>
  );
}
